import { createStore } from "redux";
import { authorizeReducer } from "./reducers/authorizeReducer.js";

export const store = createStore(
  authorizeReducer,
  { isLoggedIn: false },
  window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__()
);
